<!DOCTYPE html>
<html>
  <head>
    <title>Eva's Game</title>
    <meta charset="utf-8" />
<style>
html,
body,
.root {
  height: 100%;
  margin: 0;
}

body {
  font-size: 24px;
  font-family: "Gill Sans", "Gill Sans MT", Calibri, "Trebuchet MS", sans-serif;
}

/* --- Dialog --- */
.dialog-cover,
.dialog-cover .dialog-container {
  display: flex;
  align-items: center;
  justify-content: center;
}

.dialog-cover {
  position: fixed;
  left: 0;
  top: 0;
  right: 0;
  bottom: 0;
  z-index: 1999;
}

.dialog-cover .dialog-container {
  width: 400px;
  min-height: 200px;
  color: white;
  background: rgb(135, 78, 226);
  border: 2px solid white;
  box-shadow: 0.5em 0.5em 1em rgba(0, 0, 0, 0.15);
  cursor: pointer;
  text-align: center;
}

.dialog-cover .dialog-container {
  opacity: 0;
  position: relative;
  top: 80px;
  transition: all 300ms ease-out;
}

.dialog-cover.show .dialog-container {
  opacity: 1;
  top: 0;
}

/* --- Scroller --- */
.root {
  display: flex;
  align-items: center;
  justify-content: center;
}

.container {
  position: relative;
  background-image: linear-gradient(blue, white);
  width: 100%;
  height: 200px;
}

.container .grass {
  position: absolute;
  bottom: 0;
  width: 100%;
  background-color: green;
}

.scroller {
  position: relative;
  height: 100%;
  overflow: hidden;
}

.scroll-container {
  height: 100%;
}

/* --- Score --- */
.score {
  position: absolute;
  left: 0;
  top: 0;
  padding: 10px;
}

.score .points {
  position: relative;
  line-height: 96px;
  font-size: 48px;
}

/* --- Controls --- */

[data-dialog] .controls {
  display: none;
}

.controls {
  position: absolute;
  right: 0;
  top: 0;
  height: calc(100% - 20px);
  padding: 10px;
  display: flex;
  flex-direction: column;
  justify-content: space-around;
  z-index: 1;
}

.score .points,
.controls button {
  width: 96px;
  height: 96px;
  padding: 0;
  border-radius: 50%;
  background: rgb(135, 78, 226);
  color: white;
  text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.25);
  border: 2px solid white;
  text-align: center;
}

.controls button {
  font-size: 64px;
}

.controls button:hover {
  box-shadow: 0.05em 0.05em 0.2em rgba(0, 0, 0, 0.35);
}
.controls button:active {
  box-shadow: 0 0 0.1em rgba(0, 0, 0, 0.15) inset;
  background: rgb(104, 56, 183);
}

/* --- Player --- */

.player-container,
.obstacle-container {
  position: absolute;
  margin: 0 -30% 0 30%;
}

.player-container {
  bottom: 0;
}

.player-shadow {
  position: absolute;
  margin-top: -50%;
  right: 0;
  border-radius: 50%;
  background-color: rgba(0, 0, 0, 0.25);
}

.player {
  position: absolute;
  right: 0;
}

<script>
(function (game) {
  const Constants = game.Constants;
  const Utilities = {
    /**
     * Create a new element, optionally assigning a css class.
     * @param {string} tagName Type of element to create.
     * @param {string?} className Name of class to assign.
     * @param {HTMLElement} parent Parent element to attach to, if any.
     */
    createElement: function (tagName, className, parent) {
      const element = document.createElement(tagName);
      if (className) {
        element.className = className;
      }
      if (parent) {
        parent.appendChild(element);
      }
      return element;
    },

    /**
     * Removes the given element from its parent (if any), returning the removed
     * element.
     * @param {HTMLElement} element Element to remove.
     */
    removeElement: function (element) {
      element &&
        element.parentElement &&
        element.parentElement.removeChild(element);
      return element;
    },

    /**
     * Apply the given styles to the element.
     * @param {HTMLElement} element Element to apply styles to.
     * @param {object:CSSProperties} style Styles to apply.
     */
    applyStyle: function (element, style) {
      Object.keys(style).forEach(function (key) {
        element.style[key] = style[key];
      });
      return element;
    },

    /**
     * Returns a layer mapped to scale and offset for each lane.
     * @param {number} layer Layer number.
     */
    mapLayer: function (layer) {
      const scale =
        Math.pow(Constants.LAYER_SCALE, layer) * Constants.TILE_SIZE;
      return {
        scale: scale,
        bottom: (Constants.TILE_SIZE - scale) * Constants.LAYER_OFFSET,
      };
    },
  };
  game.Utilities = Utilities;
})(window.game || {});
</script>
<script>
(function (game) {
  const Utilities = game.Utilities;
  /**
   * Simple dialog message, tap to close.
   * @param {string | string[]} message Message to show in dialog.
   * @param {function} onClose Callback when dialog ends.
   */
  const Dialog = function (message, onClose) {
    const cover = Utilities.createElement("div", "dialog-cover", document.body);
    cover.innerHTML = [
      '<div class="dialog-container">',
      '<div class="dialog-message">',
      Array.isArray(message)
        ? message
            .map(function (para) {
              return `<p>${para}</p>`;
            })
            .join("")
        : message,
      "</div>",
      "</div>",
    ].join("");

    const close = this.close.bind(this);
    const onKey = this.onKey.bind(this);
    cover.querySelector(".dialog-container").addEventListener("click", close);
    document.addEventListener("keypress", onKey);
    setTimeout(function () {
      cover.className += " show";
    }, 0);
    this._cover = cover;
    this._onKey = onKey;
    this._onClose = onClose;
  };

  /**
   * Handle a key event to close the dialog.
   * @param {KeyboardEvent} e Triggering event.
   */
  Dialog.prototype.onKey = function (e) {
    switch (e.key) {
      case "Return":
      case "Enter":
      case "Escape":
      case " ":
        this.close();
        break;
    }
  };

  /**
   * Close the dialog and fire the close handler.
   */
  Dialog.prototype.close = function () {
    const onClose = this._onClose;
    const cover = this._cover;
    document.removeEventListener("keypress", this._onKey);
    this._cover.className = this._cover.className.replace("show", "");
    setTimeout(function () {
      Utilities.removeElement(cover);
      onClose();
    }, 300);
  };

  game.Dialog = Dialog;
  game.showDialog = function (message, onClose) {
    const dialog = new Dialog(message, onClose);
  };
})(window.game || {});
</script>
<script>
(function (game) {
  const Utilities = game.Utilities;

  /**
   * Initialize a new instance of the ScoreboardSprite class.
   * @param {HTMLElement} element Container element where to append sprite.
   * @param {number} delay Delay before animating (ms).
   */
  const ScoreboardSprite = function (element, delay) {
    this._el = Utilities.createElement("div", "scoreboard-sprite", element);
    this._t0 = new Date().valueOf() + delay;
    this._vx = (-0.5 + Math.random()) * 20;
    this._vy = -0.5 * Math.random() * 20;
  };

  ScoreboardSprite.constants = {
    /** Gravity change per tick. */
    GRAVITY: 1.1,
    /** Speed scale factor. */
    SPEED: 12,
    /** Lifetime of the sprite, in ms. */
    LIFETIME: 1200,
  };

  /**
   * Advance the animation, returning TRUE when the animation has finished.

      return;
    } else if (T >= 1) {
      Utilities.removeElement(this._el);
      return true;
    }

    const dt = T * ScoreboardSprite.constants.SPEED;
    const x0 = 0;
    const y0 = 0;
    const x = x0 + this._vx * dt;
    const y = y0 + this._vy * dt + ScoreboardSprite.constants.GRAVITY * dt * dt;
    Utilities.applyStyle(this._el, {
      left: `${x}px`,
      top: `${y}px`,

  const Scoreboard = function (element) {

    this._element = element;
    /** Current score. */

    /** Animation sprites. */
    this._sprites = [];

   * Returns the current score value.

  Scoreboard.prototype.score = function () {
    return this._score;

   * @param {number} score New score to set to.

  Scoreboard.prototype.setScore = function (score) {
    this._score = score;
    if (this._element) {
      this._element.innerText = `${this._score}`;
    }
    return this;
  };

   * Increment (or decrement, with negative number) the current score.
   * @param {number} increment Amount to increment by.

    if (increment < 0) {

   * Reset the score to zero.

  Scoreboard.prototype.reset = function () {
    this.setScore(0);

  /**
   * Animate a loss of points.
   * @param {number} count Number of losses to animate.

  Scoreboard.prototype.animateLoss = function (count) {
    const container = this._element && this._element.parentElement;
    if (!container) {

    for (let k = 0; k < count; k += 1) {
      const sprite = new ScoreboardSprite(container, k * 0);

      this._timer = setInterval(this.animateTick.bind(this), 40);

   * Animation tick.

  Scoreboard.prototype.animateTick = function () {
    for (let k = this._sprites.length - 1; k >= 0; k -= 1) {

      this._timer = null;

<script>
(function (game) {
  const Utilities = game.Utilities;

  /**
   * Create a new Lane that comprises background and obstacles.
   */
  const Lane = function () {
    const anchor = document.createElement("div");
    anchor.className = "lane-container";
    anchor.innerHTML = [
      '<div class="background"></div>',
      '<div class="obstacle-container"></div>',
    ].join("");
    this._anchor = anchor;
    this._background = anchor.querySelector(".background");

    /** Graphics scale. */
    this._scale = 1;
    /** Logical layer of this lane. */
    this._layer = 0;
    /** Obstacles on this lane. */
    this._obstacles = [];
  };

  /**
   * Attach this lane to the given DOM container.
   * @param {HTMLElement} container Container where to attach the lane graphics.
   */
  Lane.prototype.appendTo = function (container) {
    container.appendChild(this._anchor);
  };

  /**
   * Update the scroll render.
   */
  Lane.prototype.render = function () {
    const z = game.state.T * game.state.scrollSpeed;
    Utilities.applyStyle(this._background, {
      backgroundPosition: `${-this._scale * (z % 1)}px 100%`,
    });
    this._obstacles.forEach(function (obstacle) {
      obstacle.render();
    });
    return this;
  };

  /**
   * Update the transverse position of this layer. Returns instance for
   * chaining.
   * @param {number} layer Layer position. 0 = current, +ve foreground,
   * -ve background.
   */
  Lane.prototype.setLayer = function (newLayer) {
    this._layer = newLayer;
    const pos = Utilities.mapLayer(newLayer);
    this._scale = pos.scale;
    Utilities.applyStyle(this._anchor, {
      bottom: `${pos.bottom}px`,
    });
    Utilities.applyStyle(this._background, {
      backgroundSize: `${pos.scale}px`,
    });
    this._obstacles.forEach(function (obstacle) {
      obstacle.setLayer(newLayer);
    });
    return this;
  };

  /**
   * Reset the game of its obstacles.
   */
  Lane.prototype.reset = function () {
    while (this._obstacles.length) {
      this._obstacles.pop().destroy();
    }
    return this;
  };

  /**
   * Add a new obstacle to this lane.
   * @param {string} className Name of obstacle to add.
   * @param {number} z Distance to set obstacle for.
   */
  Lane.prototype.addObstacle = function (className, z) {
    const obstacleContainer = this._anchor.querySelector(".obstacle-container");
    this._obstacles.push(
      new game.Obstacle(obstacleContainer, className, z).setLayer(this._layer)
    );
  };

  /**
   * Returns a collision value of any obstacles that are colliding in this lane.
   * @param {boolean} isJumping Value indicating whether the player is jumping.
   */
  Lane.prototype.isCollision = function (isJumping) {
    let collision = undefined;
    this._obstacles.forEach(function (obstacle) {
      collision = collision || obstacle.isCollision(isJumping);
    });
    return collision;
  };
  game.Lane = Lane;
})(window.game || {});
</script>

    let bottom = pos.bottom;
    const T = game.state.T;
    const style = {
      transform: "",
      width: `${pos.scale}px`,
    };
    if (this._crashT !== null) {
      let t = T - this._crashT;
      style.transform = `rotate(${(400 * Math.sqrt(t)) % 360}deg) scale(-1, 1)`;
    } else if (this._jumpT !== null) {
      let t = ((T - this._jumpT) * game.state.scrollSpeed) / JUMP_DUR;
      if (t >= 1) {
        this._jumpT = null;
        t = 1;
      }
      const tt = 2 * (t - 0.5); // -1..1
      bottom += JUMP_HEIGHT * pos.scale * (1 - tt * tt);
      style.transform = `rotate(${20 * tt}deg) scale(-1, 1)`;
    } else if (game.state.isScrolling) {
      bottom += 2 * (((2 * T) % 1) - 1 / 2 > 0 ? 1 : 0);
    }
    style.bottom = `${bottom + 0.1 * BOTTOM_OFFSET}px`;
    Utilities.applyStyle(this._element, style);
    Utilities.applyStyle(this._shadow, {
      width: `${pos.scale}px`,
      height: `${0.2 * pos.scale}px`,
      bottom: `${pos.bottom + 0.08 * pos.scale}px`,
    });
    return this;
  };

  Player.prototype.jump = function () {
    if (this._jumpT) return;

   * Returns a value indicating whether the player is jumping.
   */
  Player.prototype.isJumping = function () {
    return !!this._jumpT;
  };

  /**
   * Trigger the crash animation.
   */
  Player.prototype.crash = function () {
    this._crashT = game.state.T;
  };

<script>
(function (game) {
  const Utilities = game.Utilities;
  const Constants = game.Constants;

  /**
   * Create an obstacle at some distance (time) in the future.
   * @param {HTMLDivElement} container Where to attach myself.
   * @param {string} obstacleType Type of obstacle image to display.
   * @param {number} z Distance where to place obstacle.
   */
  const Obstacle = function (container, obstacleType, z) {
    obstacleType = obstacleType || "fence";
    const el = document.createElement("div");
    el.className = `obstacle ${obstacleType}`;
    container.appendChild(el);
    this._el = el;
    /** Type of obstacle. */
    this._obstacleType = obstacleType;
    /** Graphics scale factor from parent lane. */
    this._scale = 1;
    /** Position in game time coordinates. */
    this._z = z;
    /** Game time when crash animation starts. */
    this._crashT = null;
  };

  /**
   * Update the current obstacle graphics.
   */
  Obstacle.prototype.render = function () {
    const z = game.state.T * game.state.scrollSpeed;
    if (this._z - z < -10) {
      return;
    }
    /** Value indicating whether obstacle is in front of player (to viewer). */
    const inFront = this._layer < game.state.layer;
    /** Value indicating whether to dim the obstacle. */
    const dimObstacle =
      ["tree"].includes(this._obstacleType) && game.state.layer !== this._layer;
    const style = {
      left: `${this._scale * (this._z - z)}px`,
      opacity: dimObstacle ? 0.5 : 1,
      zIndex: inFront ? "1" : "",
    };
    if (this._crashT) {
      const t = game.state.T - this._crashT;
      switch (this._obstacleType) {
        case "apple":
        case "apples":
          style.bottom = `${this.bottom() + this._scale * t}px`;
          style.opacity = Math.max(0, 1 - t);
      }
    }
    Utilities.applyStyle(this._el, style);
  };

  /** Relative bottom position. */
  const OBSTACLE_BOTTOM = {
    river: -0.12,
    _default: 0.05,
  };

  /** Returns the default bottom position. */
  Obstacle.prototype.bottom = function () {
    return (
      (OBSTACLE_BOTTOM.hasOwnProperty(this._obstacleType)
        ? OBSTACLE_BOTTOM[this._obstacleType]
        : OBSTACLE_BOTTOM._default) * this._scale
    );
  };

  /**
   * Update the lane layer for this obstacle, which affects scaling and z-index.
   * @param {number} newLayer Lane layer this obstacle belongs to.
   */
  Obstacle.prototype.setLayer = function (newLayer) {
    this._layer = newLayer;
    const pos = Utilities.mapLayer(newLayer);
    this._scale = pos.scale;
    Utilities.applyStyle(this._el, {
      width: `${this._scale}px`,
      marginLeft: `${-0.5 * this._scale}px`,
      height: `${2 * this._scale}px`,
      bottom: `${this.bottom()}px`,
    });
    this._el.setAttribute("data-parity", newLayer % 2 ? "odd" : "even");
    return this;
  };

  /**
   * Returns a value indicating whether this obstacle is colliding.
   * @param {boolean} isJumping Value indicating whether the player is jumping.
   */
  Obstacle.prototype.isCollision = function (isJumping) {
    const t = game.state.T * game.state.scrollSpeed - this._z;
    const isColliding = 0 <= t && t < 0.7;
    if (!isColliding) {
      return undefined;
    }
    switch (this._obstacleType) {
      case "fence":
      case "river":
        return !isJumping && Constants.COLLISION.CRASH;
      case "tree":
        return Constants.COLLISION.CRASH;
      case "apple":
      case "apples":
        if (!isJumping && !this._crashT) {
          this._crashT = game.state.T;
          return this._obstacleType === "apple"
            ? Constants.COLLISION.SCORE
            : Constants.COLLISION.SCORE5;
        }
        break;
      case "barrel":
        return Constants.COLLISION.PRIZE;
    }
  };

  /**
   * Destroy this object and its DOM.
   */
  Obstacle.prototype.destroy = function () {
    this._el &&
      this._el.parentElement &&
      this._el.parentElement.removeChild(this._el);
  };
  game.Obstacle = Obstacle;
})(window.game || {});
</script>
<script>
(function (game) {
  const Controls = function (controls) {
    const _handlers = {};

    /** Attach an event listener. */
    this.on = function (eventName, handler) {
      if (!_handlers[eventName]) {
        _handlers[eventName] = [];
      }
      _handlers[eventName].push(handler);
    };

    /** Fire all event listeners with given arguments. */
    const fire = function (eventName, args) {
      _handlers[eventName] &&
        _handlers[eventName].forEach(function (handler) {
          handler.apply(null, Array.prototype.slice.call(arguments, 1));
        });
    };

    const onclick = function (e) {
      fire(e.target.getAttribute("data-action"));
      e.preventDefault();
    };

    /**
     * Attach listeners to controls.
     */
    Array.prototype.forEach.call(
      controls.querySelectorAll("[data-action]"),
      function (el) {
        el.ontouchstart = el.onclick = onclick;
      }
    );
  };
  game.Controls = Controls;
})(window.game || {});
</script>

      template: [
        //..:....|....:....|....:....|
        " a  t   t  aa  ttr   t  aa  a",
        "  a     A      a r  A t     a",
        "      a  a  a   ar      a a a",
        " a  a      A     r   a a    a",
        "   t     a  t  a raaa       a",
      ],
    },
    {
      title: "Show Jumping",
      gameLength: 30,
      obstacleDensity: 1,
      // randomize: { fence: 30, tree: 10 },
      // numApples: 20,
      scrollSpeed: 1,
      template: [
        //..:....|....:....|....:....|
        "ttttttttttttttttfAfttttttttt",
        "    f A f af    f f af aaf  ",
        "  aaf   f  faa  f f  f   faa",
        "    f  tf  f  a f f tf   f  ",
        " t  f   f  f t  f fA f   f  ",
      ],
    },
    {
      title: "The Orchard",
      gameLength: 30,
      obstacleDensity: 1,
      // randomize: { fence: 10, river: 10, tree: 70 },
      // numApples: 40,
      scrollSpeed: 1.2,
      template: [
        //..:....|....:....|....:....|
        "  tr t    taaa   ttt  r   f  ",
        "   r  tt     tt   a   r t f a",
        " a r  t    t  A    aa r a f  ",
        "   r a   A f      t   r t f  ",
        "   r   aa  f   t   t  r A f  ",
      ],
    },
    {
      title: "Crazy Times",
      gameLength: 50,
      obstacleDensity: 1,
      randomize: { fence: 10, river: 10, tree: 40 },
      numApples: 40,
      scrollSpeed: 1.3,
    },
  ];

  /** Map of characters in template to obstacle types. */
  const TEMPLATE_OBSTACLES = {
    a: "apple",
    t: "tree",
    f: "fence",
    r: "river",
    A: "apples",
  };

  /**
   * Returns a value indicating whether the obstacle crosses all lanes, e.g.
   * fence, river, and finish line.
   * @param {string} obstacleType Type of obstacle.
   */
  const isAllLanesObstacle = function (obstacleType) {
    return ["fence", "river", "apples"].includes(obstacleType);
  };

  /**
   * Determine a rand obstacle type based on the settings.
   * @param {object} types Settings with obstacle types.
   */
  const obstacleStrategy = function (types) {
    // Memoise parameters.
    let lastAllLanes = false;
    let cumulative = 0;
    const probabilities = Object.keys(types).map(function (type) {
      return {
        min: cumulative,
        max: (cumulative += types[type] / 100),
        type: type,
      };
    });

    // Return generator function.
    return function () {
      const rnd = Math.random();
      const obstacle = probabilities.find(function (prob) {
        return prob.min <= rnd && rnd < prob.max;
      });
      let obstacleType = obstacle && obstacle.type;
      let allLanes = isAllLanesObstacle(obstacleType);
      if (lastAllLanes && allLanes) {
        obstacleType = "tree";
        allLanes = false;
      }
      lastAllLanes = allLanes;
      return obstacleType;
    };
  };

  /**
   * Create obstacles from a template.
   * @param {string[]} template Obstacle template to apply.
   */
  const createObstaclesTemplate = function (settings) {
    const lanes = game.state.lanes;
    const numLanes = lanes.length;
    settings.template.forEach(function (laneTemplate, layer) {
      laneTemplate.split("").forEach(function (typeStr, z) {
        const type = TEMPLATE_OBSTACLES[typeStr];
        if (type) {
          lanes[numLanes - layer - 1].addObstacle(
            type,
            z * settings.obstacleDensity
          );
        }
      });
    });
  };

  /** Get a random lane. */
  const randomLane = function () {
    return Math.floor(game.state.lanes.length * Math.random());
  };

  /**
   * Create obstacles randomly.
   * @param {object} settings Game settings.
   */
  const createObstaclesRandom = function (settings) {
    const lanes = game.state.lanes;
    // const numLanes = lanes.length;

    // Create obstacles.
    const getObstacle = obstacleStrategy(settings.randomize);
    for (let z = 5; z < settings.gameLength; z += settings.obstacleDensity) {
      const obstacleType = getObstacle();
      if (!obstacleType) {
        continue;
      }
      if (isAllLanesObstacle(obstacleType)) {
        lanes.forEach(function (lane) {
          lane.addObstacle(obstacleType, z);
        });
      } else {
        lanes[randomLane()].addObstacle(obstacleType, z);
      }
    }
  };

  /**
   * Create obstacles for this game.
   */
  const createObstacles = function () {
    const settings = GAME_SETTINGS[game.state.level];
    /** Lane objects. */
    const lanes = game.state.lanes;
    /** Length of running track, in game units. */
    const gameLength = settings.gameLength;

    // Game props.
    game.state.scrollSpeed = settings.scrollSpeed;

    // Clear existing.
    lanes.forEach(function (lane) {
      lane.reset();
    });

    if (settings.template) {
      createObstaclesTemplate(settings);
    } else {
      createObstaclesRandom(settings);
    }

    // Add apples.
    for (let k = 0; k < settings.numApples || 0; k += 1) {
      const z = 5 + (gameLength - 5) * Math.random();
      lanes[randomLane()].addObstacle(
        Math.random() > 0.8 ? "apples" : "apple",
        z
      );
    }

    // Finish line.
    lanes.forEach(function (lane) {
      lane.addObstacle("barrel", gameLength);
    });

    // Render.
    lanes.forEach(function (lane) {
      lane.render();
    });
  };

  /**
   * Prepare for a new level.
   * @param {function} onClose Callback when ready to start.
   */
  const prepareLevel = function (onClose) {
    // game.Strategy.createObstacles();
    // onClose();
    // return;
    const element = document.body;
    element.setAttribute("data-dialog", "true");
    const showLevel = function () {
      game.showDialog(
        [
          `Level ${game.state.level + 1}`,
          GAME_SETTINGS[game.state.level].title,
        ],
        function () {
          element.removeAttribute("data-dialog");
          game.Strategy.createObstacles();
          onClose();
        }
      );
    };
    if (game.state.level === 0) {
      game.showDialog(
        [
          "Welcome to Eva's game!",
          "Help Lily eat the apples<br/>but don't crash!",
          "&uarr; and &darr; move Lily sideways",
          " makes Lily jump",
          "Tap to continue.",
        ],
        showLevel
      );
    } else {
      showLevel();
    }
  };

  /**
   * The player has crashed.
   * @param {function} onClose Callback to continue when the dialog closes.
   */
  const crash = function (onClose) {
    setTimeout(function () {
      game.showDialog(
        ["Oh no, you've crashed!", "Better luck next time!"],
        function () {
          prepareLevel(onClose);
        }
      );
    }, 1000);
  };

  /**
   * The player has reached the finish line.
   * @param {function} onClose Callback to continue when the dialog closes.
   */
  const prize = function (onClose) {
    game.showDialog(["Congratulations!", "On to the next level."], function () {
      if (game.state.level < GAME_SETTINGS.length - 1) {
        game.state.level += 1;
      }
      prepareLevel(onClose);
    });
  };

  game.Strategy = {
    prepareLevel: prepareLevel,
    crash: crash,
    prize: prize,
    createObstacles: createObstacles,
  };
})(window.game || {});
</script>
<script>
(function (game) {
  const Utilities = game.Utilities;
  const Constants = game.Constants;

  /** Cost of crashing. */
  const CRASH_COST = 5;

  document.addEventListener("DOMContentLoaded", function () {
    const containers = {
      main: document.querySelector(".container"),
      scroll: document.querySelector(".scroll-container"),
      grass: document.querySelector(".grass"),
      play: document.querySelector(".player-container"),
      points: document.querySelector(".points"),
    };
    const player = new game.Player(containers.play);
    const scoreboard = new game.Scoreboard(containers.points);
    const numLanes = 5;

    Utilities.applyStyle(containers.main, {
      height: `${2 * game.Constants.TILE_SIZE}px`,
    });
    const pos = Utilities.mapLayer(numLanes);
    Utilities.applyStyle(containers.grass, {
      height: `${pos.bottom}px`,
    });

    // Create lanes.
    const lanes = [];
    for (let layer = 0; layer < numLanes; layer += 1) {
      lanes.push(new game.Lane().setLayer(layer));
    }
    for (let layer = numLanes - 1; layer >= 0; layer -= 1) {
      lanes[layer].appendTo(containers.scroll);
    }
    game.state.lanes = lanes;

    /** Update the playing layer. */
    const setLayer = function (newLayer) {
      if (newLayer === undefined) {
        newLayer = Math.floor((numLanes - 1) / 2);
      }
      if (newLayer >= 0 && newLayer < numLanes) {
        game.state.layer = newLayer;
      }
    };

    /** Current playing layer. */
    setLayer();

    /** Start of game. */
    let startDate = new Date();
    /** Start of game in game time. */
    game.state.T = 0;
    /** Value indicating whether we're already crashing. */
    game.state.isCrashing = false;

    /**
     * Start a new game.
     */
    /** Value indicating whether the time should be advancing. */
    game.state.isScrolling = true;

    /**
     * The player reaches the finish line.
     */
    const prize = function () {
      game.state.isScrolling = false;
      game.Strategy.prize(restart);
    };

    /**
     * Update the render function.
     * @param {boolean?} cont Optional value indicating whether to continue
     * the animation. Set to FALSE to stop the rendering loop.
     */
    const render = function (cont) {
      game.state.T = (new Date() - startDate) / 1000;
      player.render();
      if (game.state.isScrolling) {
        lanes.forEach(function (lane) {
          lane.render();
        });
        const isJumping = player.isJumping();
        const collision = lanes[game.state.layer].isCollision(isJumping);
        switch (collision) {
          case Constants.COLLISION.CRASH:
            if (game.state.isCrashing) {
              // Debounce crashes.
              break;
            }

            if (scoreboard.score() >= CRASH_COST) {
              scoreboard.inc(-CRASH_COST);
            } else {
              game.state.isScrolling = false;
              player.crash();
              game.Strategy.crash(restart);
            }
            game.state.isCrashing = true;
            break;
          case Constants.COLLISION.SCORE:
            scoreboard.inc(1);
            break;
          case Constants.COLLISION.SCORE5:
            scoreboard.inc(5);
            break;
          case Constants.COLLISION.PRIZE:
            prize();
            break;
        }
        if (collision !== Constants.COLLISION.CRASH) {
          game.state.isCrashing = false;
        }
      }
      if (cont !== false) {
        requestAnimationFrame(render);
      }
    };

    const start = function () {
      startDate = new Date();
      render();
    };

    const stop = function () {
      render(false);
    };

    const restart = function () {
      scoreboard.reset();
      game.state.isScrolling = true;
      setLayer();
      player.reset().render();
      start();
    };

    const fore = function () {
      setLayer(game.state.layer - 1);
    };
    const back = function () {
      setLayer(game.state.layer + 1);
    };

    const controls = new game.Controls(document.querySelector(".controls"));
    controls.on("jump", function () {
      player.jump();
    });
    controls.on("restart", restart);
    controls.on("fore", fore);
    controls.on("back", back);
    controls.on("pause", function () {
      timer ? stop() : start();
    });

    player.render();
    lanes.forEach(function (lane) {
      lane.render();
    });

    game.state.level = 0;
    game.Strategy.prepareLevel(restart);

    document.addEventListener("keydown", function (e) {
      switch (e.key) {
        case "ArrowUp":
          back();
          break;
        case "ArrowDown":
          fore();
          break;
        case " ":
          player.jump();
          break;
        case "~":
          prize();
          break;
      }
    });

    containers.points.addEventListener("click", prize);
  });
})(window.game);
</script>

  </head>
  <body>
    <div class="root">
      <div class="container">
        <div class="grass"></div>
        <div class="scroller">
          <div class="scroll-container"></div>
          <div class="player-container"></div>
        </div>
        <div class="controls">
          <button data-action="back">&uarr;</button>
          <button data-action="jump"></button>
          <button data-action="fore">&darr;</button>
        </div>
        <div class="score">
          <div class="points">0</div>
        </div>
      </div>
    </div>
  </body>
